    // Read functions read the values of an output node from the model.
    // Delay correction is applied if the model is bit-accurate
    // but not cycle accurate to simulate latency from delay balancing.
    // DSP Builder applies this same adjustment for bit-accurate
    // non-cycle accurate simulation in Simulink.
    // 
    // Read functions will append output to stimulus files if compiling
    // with WRITE_STM_FILES defined.
    // 
    // Read functions should be called once per cycle per instance.
    // Subsequent calls in the same cycle will copy output values to the
    // provided struct, but will not write stimulus or update internal state.
    void read(io_struct_ChannelOut& output)
    {
        bool needsToExecute = (m_io_cycle[1] == m_update_cycle);
        if (needsToExecute)
        {
            m_io_cycle[1]++;
            execute();
            m_delay_correction_ChannelOut_port_out_1_qv_tpl.delay(m_n[CHANNELOUT_CUNROLL_X_OUT_1_QV_TPL_7]);
            m_delay_correction_ChannelOut_port_out_2_qc_tpl.delay(m_n[CHANNELOUT_CUNROLL_X_OUT_2_QC_TPL_7]);
            m_delay_correction_ChannelOut_port_out_3_real_q_tpl.delay(m_n[CHANNELOUT_CUNROLL_X_OUT_3_REAL_Q_TPL_7]);
            m_delay_correction_ChannelOut_port_out_3_imag_q_tpl.delay(m_n[CHANNELOUT_CUNROLL_X_OUT_3_IMAG_Q_TPL_7]);
        }

#ifndef DISABLE_DELAY_CORRECTON
        csl_memcpy(&output.port_out_1_qv_tpl, &m_delay_correction_ChannelOut_port_out_1_qv_tpl.get(), 1);
        csl_memcpy(&output.port_out_2_qc_tpl, &m_delay_correction_ChannelOut_port_out_2_qc_tpl.get(), 1);
        csl_memcpy(&output.port_out_3_real_q_tpl, &m_delay_correction_ChannelOut_port_out_3_real_q_tpl.get(), 2);
        csl_memcpy(&output.port_out_3_imag_q_tpl, &m_delay_correction_ChannelOut_port_out_3_imag_q_tpl.get(), 2);
#else
        csl_memcpy(&output.port_out_1_qv_tpl, &m_n[CHANNELOUT_CUNROLL_X_OUT_1_QV_TPL_7], 1);
        csl_memcpy(&output.port_out_2_qc_tpl, &m_n[CHANNELOUT_CUNROLL_X_OUT_2_QC_TPL_7], 1);
        csl_memcpy(&output.port_out_3_real_q_tpl, &m_n[CHANNELOUT_CUNROLL_X_OUT_3_REAL_Q_TPL_7], 2);
        csl_memcpy(&output.port_out_3_imag_q_tpl, &m_n[CHANNELOUT_CUNROLL_X_OUT_3_IMAG_Q_TPL_7], 2);
#endif

#ifdef WRITE_STM_FILES
        if (needsToExecute)
        {
            m_stm_channelout.write_stm_data(output.port_out_1_qv_tpl, 1);
            m_stm_channelout.write_stm_data(output.port_out_2_qc_tpl, 8);
            m_stm_channelout.write_stm_data(output.port_out_3_real_q_tpl, 16);
            m_stm_channelout.write_stm_data(output.port_out_3_imag_q_tpl, 16);
            m_stm_channelout.next_line();
        }
#endif
    }

    // Write functions write the values of an input node to the model
    // and initiates any internal simulation that depends on that 
    // input and any other inputs previously provided for the
    // current cycle. When all inputs nodes have been provided,
    // the next cycle will begin automatically.
    // 
    // Write functions will append output to stimulus files if compiling
    // with WRITE_STM_FILES defined.
    // 
    // Write functions should be called once per cycle per instance.
    // Subsequent calls in the same cycle will do nothing.
    void write(const io_struct_ChannelIn& input)
    {
        bool needsToExecute = (m_io_cycle[0] == m_update_cycle);
        if (needsToExecute)
        {
            csl_memcpy(&m_n[CHANNELIN_CUNROLL_X_CHANNELIN_CUNROLL_X_IN_1_V_TPL_6], &input.port_in_1_v_tpl, 1);
            csl_memcpy(&m_n[CHANNELIN_CUNROLL_X_CHANNELIN_CUNROLL_X_IN_2_C_TPL_6], &input.port_in_2_c_tpl, 1);
            csl_memcpy(&m_n[CHANNELIN_CUNROLL_X_CHANNELIN_CUNROLL_X_IN_3_REAL_X_TPL_6], &input.port_in_3_real_x_tpl, 2);
            csl_memcpy(&m_n[CHANNELIN_CUNROLL_X_CHANNELIN_CUNROLL_X_IN_3_IMAG_X_TPL_6], &input.port_in_3_imag_x_tpl, 2);
#ifdef WRITE_STM_FILES
            m_stm_channelin.write_stm_data(input.port_in_1_v_tpl, 1);
            m_stm_channelin.write_stm_data(input.port_in_2_c_tpl, 8);
            m_stm_channelin.write_stm_data(input.port_in_3_real_x_tpl, 16);
            m_stm_channelin.write_stm_data(input.port_in_3_imag_x_tpl, 16);
            m_stm_channelin.next_line();
#endif
            m_io_cycle[0]++;
            execute();
        }
    }

private:
    // Segments are chunks of execution that depend on unique sets of inputs
    // These functions are invoked automatically as inputs are provided to the model.
    void execute_segment_0();
    void execute_segment_1();
    void execute_segment_update();

    // Progresses the internal simulation state based on the currently
    // available input values
    void execute()
    {
        if ((m_segment_cycle[0] == m_update_cycle))
        {
            execute_segment_0();
            ++m_segment_cycle[0];
        }
        if ((m_segment_cycle[1] == m_update_cycle) && (m_io_cycle[0] > m_update_cycle))
        {
            execute_segment_1();
            ++m_segment_cycle[1];
        }
        const bool all_io_ready = (m_io_cycle[0] > m_update_cycle) && (m_io_cycle[1] > m_update_cycle);
        if (all_io_ready && (m_segment_cycle[0] > m_update_cycle) && (m_segment_cycle[1] > m_update_cycle))
        {
            execute_segment_update();
            ++m_update_cycle;
        }
    }

